import React from 'react'
import styled from '@emotion/styled';

const StyledMain = styled.div`
    margin: auto;
`;

const Home = () => {
    return (
        <StyledMain>
            Import
            Paste
            Manual
        </StyledMain>
    )
}

export default Home;
